import { useEffect, useState } from 'react';
import { v4  } from 'uuid';
import React from 'react'

let UserData =[]
fetch('https://jsonplaceholder.typicode.com/users')
      .then(response => response.json())
      .then(users => UserData=users);

export default UserData;
